</h3><p>Alongside used equipment sales, we offer expert consultancy, procurement services and bespoke sourcing - plus the experience of a trusted global team.</p>\"}',1,'2025-07-04 16:02:13','2025-07-04 16:02:13','6e390bd6-1b93-4dcc-9208-a27402ea61b7'),(1267,1267,1,'Homepage','homepage','__home__',NULL,1,'2025-07-04 16:02:13','2025-07-04 16:02:13','66cd2ef7-9fb8-4d49-be84-96148e560c80'),(1271,1271,1,NULL,NULL,NULL,'{\"d5bb4d27-0faa-4ca7-a117-29d8cf469c4e\": \"<h3>Privacy policy</h3><p>Specialist Underwater Brokerage Limited (sub) is committed to protecting your privacy. When you browse through this website, sub collects information to enable it to track the usability and efficiency of the website. This information includes the number of times a web page is accessed, the browser used and the paths taken when moving through the website. sub does not store credit card details, nor does it share customer details with any third parties unless explicitly stated in this privacy policy.</p><p>sub may change this policy from time to time by updating this page. You should check this page to ensure that you are happy with any changes. This policy is effective from 25/02/2020.</p><p>Collecting Your Personal Information</p><p>sub will make clear if it is asking to collect information, which may directly or indirectly identify you (personal information) or allows the company to contact you and give the opportunity to opt out.</p><p>sub collects information from you when you subscribe to the DEEPSEARCH and SURVEYSEARCH publications, fill out a form or enter information on the website.</p><p>What is Collected</p><p>sub may collect the following information:</p><ul><li>Name and job title</li><li>Contact information including email address and phone number</li><li>Demographic information such as postcode</li><li>Other information relevant to customer surveys and/or offers</li><li>User data (see the Use of Cookies section below for more information)</li></ul><p>Use of Your Personal Information</p><p>Specialist Underwater Brokerage Limited may use your personal information for the following primary purposes:</p><p> To make the website easier for you to use by asking you to enter your personal information<br /> Internal record keeping<br /> sub may periodically send promotional emails about new products and services, special offers or other information that sub thinks you may find interesting, using the email address which you have provided with your expressed permission<br /> From time to time, sub may also use your information to contact you for market research purposes or marketing communications upon your consent<br /> To provide online services<br /> To help sub create and deliver content most relevant to you<br /> sub does not share this information with any other organisation or third party unless explicitly stated in this privacy policy<br /> sub will not disclose your personal information, without notice, and then, only if required to do so by law</p><p>Protecting Visitor Information</p><p>sub\'s website is scanned on a regular basis for security holes and known vulnerabilities in order to make your visit to its site as safe as possible.</p><p> sub uses regular Malware Scanning<br /> sub uses an SSL certificate</p><p>Recording and Managing Consent</p><p>sub will keep a record of when and how individuals gave consent and this can be withdrawn at any time by e-mailing sales@sub-ltd.com or unsubscribe from the DEESPSEARCH and SURVEYSEARCH lists via this link <a href=\\\"https://bit.ly/37sfCms\\\">https://bit.ly/37sfCms</a>. sub will act on withdrawals of consent as soon as possible and will not penalise individuals who wish to withdraw consent.</p><p>All individuals who give their personal information have the right to access their personal data at any time. All individuals also have the right to rectify personal data that is inaccurate or completed it if incomplete. sub has processes in place to ensure that individuals are responded to without undue delay and within one month of receipt. sub is aware of the circumstances when this time limit can extend to respond to a request.</p><p>Changes to Information</p><p>sub regularly reviews and, where necessary, updates its privacy information.</p><p>If sub plans to use your personal data for a new purpose, the privacy information will be updated and changes will be communicated to individuals before starting any new processing.</p><p>Use of Cookies</p><p>To ensure this website meets visitor needs, sub collects website statistics using cookies.</p><p>How and why we use cookies</p><p>sub uses cookies to give you the best possible experience on the website. Cookies allow you to subscribe to the DEEPSEARCH and SURVEYSEARCH publications and access the full website.</p><p>When you visit this site, we ask for your consent to use cookies. However, this Cookie Policy allows you to amend your preference for tailored content cookies. To find out more about how we use cookies and what benefits they bring, please take a few moments to read this Cookie Policy.</p><p>What are cookies?</p><p>Cookies are small text files that are sent to and stored on your computer, smartphone or other device for accessing the internet, whenever you visit a website. Cookies are useful because they allow a website to recognise a user\'s device. sub uses cookies for a variety of reasons, such as to determine preferences, let users navigate between pages efficiently, verify the user and carry out other essential security checks. Some of the functions that cookies perform can also be achieved using similar technologies. This policy refers to cookies throughout, however it also covers these alternate mechanisms. More information about cookies can be found on the All About Cookies website. This link will open in a new window website.</p><p>Controlling Your Personal Information</p><p>You may choose to restrict the collection or use of your personal information in the following ways:</p><p> Whenever you are asked to fill in a form on the sub website, look for the box that you can click to indicate that you want the information to be used for direct marketing purposes, email or customed online advertising. These will be clearly displayed and will always link back to this policy.<br /> If you have previously agreed to sub using your personal information for direct marketing purposes, you may change your mind at any time by writing to the address listed below or emailing <a href=\\\"mailto:sales@sub-ltd.com\\\">sales@sub-ltd.com</a></p><p>Specialist Underwater Brokerage Limited will not sell, distribute or lease your personal information to third parties unless it has your permission or are required by law to do so. sub may use your personal information to send you promotional information about third parties which sub thinks you may find interesting, if you tell the company that you wish this to happen. You may request details of personal information which sub holds about you under the General Data Protection Regulation (GDPR). If you would like a copy of the information held on you, please write to the sub head office address listed below or email sales@sub-ltd.com. Please note that it may take up to one month of receipt to provide this information.</p><p>To find out more about GDPR, follow the links below to read the guidelines and information published by the Information Commissioners Office:</p><p>GDPR guide to individual rights</p><p>Guide to GDPR</p><p>If you believe that any information sub holds on you is incorrect or incomplete, please write to the company on the address below or email sales@sub-ltd.com as soon as possible. sub will promptly correct any information found to be incorrect. sub has an obligation to delete or anonymise your personal data when it is no longer necessary to process the data for the purpose it was collected for. Additionally, you have a right to request sub to delete your personal data in certain situations. You also have the right to require that sub (temporarily) restricts the processing of your personal data in certain circumstances. In certain circumstances, e.g. where the legal basis for processing is a legitimate interest, you may object to the continued processing. If you do so, sub will re-evaluate the legitimate interest and the interest of your data privacy. sub will only continue the processing activity if i) there are compelling legitimate reasons for the processing which outweigh your interests, rights and freedoms; or ii) the processing is necessary to establish, enforce or defend against legal claims.</p><p>Security</p><p>sub is committed to ensuring that your information is secure. To prevent unauthorised access or disclosure, sub has put in place suitable physical, electronic and managerial procedures to safeguard and secure the information it collects online.</p><p>Links to Other Websites</p><p>subs website may contain links to other websites of interest. However, once you have used these links to leave its site, you should note that sub does not have any control over that other website. Therefore, sub cannot be responsible for the protection and privacy of any information which you provide while visiting such sites and such sites are not governed by this privacy statement. You should exercise caution and look at the privacy statement applicable to the website in question. sub does not sell, trade, or otherwise transfer to outside parties your personally identifiable information unless it provides you with advance notice. This does not include website hosting partners and other parties who assist the company in operating its website, conducting its business or servicing you, so long as those parties agree to keep this information confidential. sub may also release your information when it believes release is appropriate to comply with the law, enforce its site policies, or protect its or others rights, property or safety.</p><p>Changes to this Statement</p><p>sub may occasionally update this privacy statement. When this is done, sub will also revise the last updated date of the privacy statement.</p><p>Track Signals</p><p>sub honours Do Not Track (DNT) signals and do not track, plant cookies or use advertising when a DNT browser mechanism is in place.</p><p>COPPA (Children Online Privacy Protection Act)</p><p>When it comes to the collection of personal information from children under 13, the Children\'s Online Privacy Protection Act (COPPA) puts parents in control. The Federal Trade Commission and the nation\'s Consumer Protection Agency enforces the COPPA Rule, which spells out what operators of websites and online services must do to protect children\'s privacy and safety online. sub does not specifically market to children under 13.</p><p>Fair Information Practices</p><p>The Fair Information Practices Principles form the backbone of privacy law in the United States and the concepts they include have played a significant role in the development of data protection laws around the globe. Understanding the Fair Information Practice Principles and how they should be implemented is critical to comply with the various privacy laws that protect personal information.</p><p>In order to be in line with Fair Information Practices, sub will take the following responsive action, should a data breach occur:</p><p> Notify the users via in site notification<br /> Contact you within seven business days</p><p>sub agrees to the individual redress principle, which requires that individuals have a right to pursue legally enforceable rights against data collectors and processors who fail to adhere to the law. This principle requires not only that individuals have enforceable rights against data users but also that individuals have recourse to courts or a government agency to investigate and/or prosecute non-compliance by data processors.</p><p>Your Right to Lodge a Complaint</p><p>The GDPR gives you right to lodge a complaint with a supervisory authority, in particular in the European state where you work, normally live, or where any alleged infringement of data protection laws occurred. The UK governing body is ICO (https://ico.org.uk/) where you can find more information about your rights and sub\'s duties under the applicable data protection legislation.</p><p>Contacting Specialist Underwater Brokerage Limited</p><p>If there are any questions regarding this privacy policy, you may contact sub using the information below.</p><p>sales@sub-ltd.com</p><p>sub-Ltd.<br />Broomfield<br />Ellon<br />Aberdeenshire<br />Scotland<br />AB41 8QY</p><p>tel: +44 (0) 1224 471013</p><p>Last updated: 25/02/2020 Third Party Disclosure</p>\"}',1,'2025-07-07 09:41:26','2025-07-28 14:57:24','17733cdd-f10a-43bd-8cb7-48c6220d9234'),(1272,1272,1,NULL,NULL,NULL,'{\"d5bb4d27-0faa-4ca7-a117-29d8cf469c4e\": \"<h3>Privacy policy</h3><p>Specialist Underwater Brokerage Limited (sub) is committed to protecting your privacy. When you browse through this website, sub collects information to enable it to track the usability and efficiency of the website. This information includes the number of times a web page is accessed, the browser used and the paths taken when moving through the website. sub does not store credit card details, nor does it share customer details with any third parties unless explicitly stated in this privacy policy.</p><p>sub may change this policy from time to time by updating this page. You should check this page to ensure that you are happy with any changes. This policy is effective from 25/02/2020.</p><p>Collecting Your Personal Information</p><p>sub will make clear if it is asking to collect information, which may directly or indirectly identify you (personal information) or allows the company to contact you and give the opportunity to opt out.</p><p>sub collects information from you when you subscribe to the DEEPSEARCH and SURVEYSEARCH publications, fill out a form or enter information on the website.</p><p>What is Colle