rrect. sub has an obligation to delete or anonymise your personal data when it is no longer necessary to process the data for the purpose it was collected for. Additionally, you have a right to request sub to delete your personal data in certain situations. You also have the right to require that sub (temporarily) restricts the processing of your personal data in certain circumstances. In certain circumstances, e.g. where the legal basis for processing is a legitimate interest, you may object to the continued processing. If you do so, sub will re-evaluate the legitimate interest and the interest of your data privacy. sub will only continue the processing activity if i) there are compelling legitimate reasons for the processing which outweigh your interests, rights and freedoms; or ii) the processing is necessary to establish, enforce or defend against legal claims.</p><p>Security</p><p>sub is committed to ensuring that your information is secure. To prevent unauthorised access or disclosure, sub has put in place suitable physical, electronic and managerial procedures to safeguard and secure the information it collects online.</p><p>Links to Other Websites</p><p>subs website may contain links to other websites of interest. However, once you have used these links to leave its site, you should note that sub does not have any control over that other website. Therefore, sub cannot be responsible for the protection and privacy of any information which you provide while visiting such sites and such sites are not governed by this privacy statement. You should exercise caution and look at the privacy statement applicable to the website in question. sub does not sell, trade, or otherwise transfer to outside parties your personally identifiable information unless it provides you with advance notice. This does not include website hosting partners and other parties who assist the company in operating its website, conducting its business or servicing you, so long as those parties agree to keep this information confidential. sub may also release your information when it believes release is appropriate to comply with the law, enforce its site policies, or protect its or others rights, property or safety.</p><p>Changes to this Statement</p><p>sub may occasionally update this privacy statement. When this is done, sub will also revise the last updated date of the privacy statement.</p><p>Track Signals</p><p>sub honours Do Not Track (DNT) signals and do not track, plant cookies or use advertising when a DNT browser mechanism is in place.</p><p>COPPA (Children Online Privacy Protection Act)</p><p>When it comes to the collection of personal information from children under 13, the Children\'s Online Privacy Protection Act (COPPA) puts parents in control. The Federal Trade Commission and the nation\'s Consumer Protection Agency enforces the COPPA Rule, which spells out what operators of websites and online services must do to protect children\'s privacy and safety online. sub does not specifically market to children under 13.</p><p>Fair Information Practices</p><p>The Fair Information Practices Principles form the backbone of privacy law in the United States and the concepts they include have played a significant role in the development of data protection laws around the globe. Understanding the Fair Information Practice Principles and how they should be implemented is critical to comply with the various privacy laws that protect personal information.</p><p>In order to be in line with Fair Information Practices, sub will take the following responsive action, should a data breach occur:</p><p> Notify the users via in site notification<br /> Contact you within seven business days</p><p>sub agrees to the individual redress principle, which requires that individuals have a right to pursue legally enforceable rights against data collectors and processors who fail to adhere to the law. This principle requires not only that individuals have enforceable rights against data users but also that individuals have recourse to courts or a government agency to investigate and/or prosecute non-compliance by data processors.</p><p>Your Right to Lodge a Complaint</p><p>The GDPR gives you right to lodge a complaint with a supervisory authority, in particular in the European state where you work, normally live, or where any alleged infringement of data protection laws occurred. The UK governing body is ICO (https://ico.org.uk/) where you can find more information about your rights and sub\'s duties under the applicable data protection legislation.</p><p>Contacting Specialist Underwater Brokerage Limited</p><p>If there are any questions regarding this privacy policy, you may contact sub using the information below.</p><p>sales@sub-ltd.com</p><p>sub-Ltd.<br />Broomfield<br />Ellon<br />Aberdeenshire<br />Scotland<br />AB41 8QY</p><p>tel: +44 (0) 1224 471013</p><p>Last updated: 25/02/2020 Third Party Disclosure</p>\"}',1,'2025-07-07 09:41:26','2025-07-07 09:41:26','2a1c3e99-758d-4849-a6d3-987dc3ac0776'),(1273,1273,1,'Privacy Policy','privacy-policy','privacy-policy',NULL,1,'2025-07-07 09:41:26','2025-07-07 09:41:26','41d97c7d-1ec6-4e0f-bb02-3c5d16a7e183'),(1277,1277,1,NULL,NULL,NULL,'{\"d5bb4d27-0faa-4ca7-a117-29d8cf469c4e\": \"<h3>Privacy policy</h3><p>Specialist Underwater Brokerage Limited (sub) is committed to protecting your privacy. When you browse through this website, sub collects information to enable it to track the usability and efficiency of the website. This information includes the number of times a web page is accessed, the browser used and the paths taken when moving through the website. sub does not store credit card details, nor does it share customer details with any third parties unless explicitly stated in this privacy policy.</p><p>sub may change this policy from time to time by updating this page. You should check this page to ensure that you are happy with any changes. This policy is effective from 25/02/2020.