ke the following responsive action, should a data breach occur:</p><p> Notify the users via in site notification<br /> Contact you within seven business days</p><p>sub agrees to the individual redress principle, which requires that individuals have a right to pursue legally enforceable rights against data collectors and processors who fail to adhere to the law. This principle requires not only that individuals have enforceable rights against data users but also that individuals have recourse to courts or a government agency to investigate and/or prosecute non-compliance by data processors.</p><p>Your Right to Lodge a Complaint</p><p>The GDPR gives you right to lodge a complaint with a supervisory authority, in particular in the European state where you work, normally live, or where any alleged infringement of data protection laws occurred. The UK governing body is ICO (https://ico.org.uk/) where you can find more information about your rights and sub\'s duties under the applicable data protection legislation.</p><p>Contacting Specialist Underwater Brokerage Limited</p><p>If there are any questions regarding this privacy policy, you may contact sub using the information below.</p><p>sales@sub-ltd.com</p><p>sub-Ltd.<br />Broomfield<br />Ellon<br />Aberdeenshire<br />Scotland<br />AB41 8QY</p><p>tel: +44 (0) 1224 471013</p><p>Last updated: 25/02/2020 Third Party Disclosure</p>\"}',1,'2025-07-28 14:57:24','2025-07-28 14:57:24','ffc5b73d-d8f9-492b-815b-aa36ff35764b'),(1294,1294,1,'Privacy Policy','privacy-policy','privacy-policy',NULL,1,'2025-07-28 14:57:24','2025-07-28 14:57:24','0e640c6c-e738-4e37-b6a9-b1a88be6f960');
