r accessing the internet whenever you visit a website cookies are useful because they allow a website to recognise a users device sub uses cookies for a variety of reasons such as to determine preferences let users navigate between pages efficiently verify the user and carry out other essential security checks some of the functions that cookies perform can also be achieved using similar technologies this policy refers to cookies throughout however it also covers these alternate mechanisms more information about cookies can be found on the all about cookies website this link will open in a new window website controlling your personal information you may choose to restrict the collection or use of your personal information in the following ways whenever you are asked to fill in a form on the sub website look for the box that you can click to indicate that you want the information to be used for direct marketing purposes email or customed online advertising these will be clearly displayed and will always link back to this policy if you have previously agreed to sub using your personal information for direct marketing purposes you may change your mind at any time by writing to the address listed below or emailing sales sub ltd com specialist underwater brokerage limited will not sell distribute or lease your personal information to third parties unless it has your permission or are required by law to do so sub may use your personal information to send you promotional information about third parties which sub thinks you may find interesting if you tell the company that you wish this to happen you may request details of personal information which sub holds about you under the general data protection regulation gdpr if you would like a copy of the information held on you please write to the sub head office address listed below or email sales sub ltd com please note that it may take up to one month of receipt to provide this information to find out more about gdpr follow the links below to read the guidelines and information published by the information commissioners office gdpr guide to individual rights guide to gdpr if you believe that any information sub holds on you is incorrect or incomplete please write to the company on the address below or email sales sub ltd com as soon as possible sub will promptly correct any information found to be incorrect sub has an obligation to delete or anonymise your personal data when it is no longer necessary to process the data for the purpose it was collected for additionally you have a right to request sub to delete your personal data in certain situations you also have the right to require that sub temporarily restricts the processing of your personal data in certain circumstances in certain circumstances e g where the legal basis for processing is a legitimate interest you may object to the continued processing if you do so sub will re evaluate the legitimate interest and the interest of your data privacy sub will only continue the processing activity if i there are compelling legitimate reasons for the processing which outweigh your interests rights and freedoms or ii the processing is necessary to establish enforce or defend against legal claims security sub is committed to ensuring that your information is secure to prevent unauthorised access or disclosure sub has put in place suitable physical electronic and managerial procedures to safeguard and secure the information it collects online links to other websites subs website may contain links to other websites of interest however once you have used these links to leave its site you should note that sub does not have any control over that other website therefore sub cannot be responsible for the protection and privacy of any information which you provide while visiting such sites and such sites are not governed by this privacy statement you should exercise caution and look at the privacy statement applicable to the website in question sub